		function gotoStore() {
			if(alphaFade > 0 && storeAdded == false) {

				ball.alpha = alphaFade;
				baby.alpha = alphaFade;
				newspaper.alpha = alphaFade;

			else {

				if (storeAdded == false) {
					storeAdded = true;
					alphaFade = 0;
					stage.addChild(storeFront);
					stage.addChild(booksBox);

						stage.addChild(unmute);

						stage.addChild(mute);

		function keyDown(event) {
			//s = 83
			//w = 87
			if (event.keyCode == 65)
				character.x = character.x - 12;
			if (event.keyCode == 68)
				character.x = character.x + 12;
			if (event.keyCode == 83) {
				character.gotoAndPlay(30);
				ducking = true;
			}
			if (event.keyCode == 87) {
				character.gotoAndPlay();
				jumping = true;
				jump();
			}
			if (finalDisp == false){
				if (character.x > ball.x - 350) {
					createjs.Sound.stop("motorbike");
					createjs.Sound.play("crash");
				}
			}
		}

			let diff = 0; 
			while (character.y <= 690) {
				diff += 0.4; 
				character.y -= diff + (0.13 * -0.25 * (diff * diff));
				await sleep(8);
			}
			character.y = 690;
		}
